Please keep in mind that this is the ouija board which caused Corey a lot of pain and trauma and is affecting his family, which just adds more pain and anxiety to him. Maybe the gang overreacts in these situations for all of you. But it's easy for us to say that they should be calm when we're not in their shoes. All my paranormal experience scared me half to death to a point where I started to cry. Just please keep in mind that they all have been through a lot and the thought of talking to an entity is scary, especially one that's been haunting one of them for years. 
And IF they lied to us by shaking the tree themselves then shame on them. Just please think before you point fingers at someone.

@Corey I wish you all the best and I hope you can get to the bottom of this when you feel ready for it, please don't push yourself too hard for us. You are important! I love you, guys 💜
